ISLAMABAD, Apr 19 (APP): A two-member delegation of Awami National Party (ANP) comprising Aimal Wali Khan and Jawad Khattak on Wednesday called on Prime Minister Muhammad Shehbaz Sharif.
During the meeting, Minister for Economic Affairs Sardar Ayaz Sadiq and Minister for Federal Education and Professional Training Rana Tanveer Hussain were also present, PM Office Media Wing said in a press release.
